import './App.css';
import {MessageList} from "./MessageList";
import React from "react";
import {QueryClient, QueryClientProvider} from "react-query";


const queryClient = new QueryClient();

function App() {

  return (
      <QueryClientProvider client={queryClient}>
          <div className="App">
              <MessageList/>
          </div>
      </QueryClientProvider>
  );
}

export default App;
